import React from 'react';
import {Card, Timeline} from "antd";

const TimelineCard = (props) => {
  console.log(props.purchase);
  return (
      <Timeline.Item>
        <Card size="small" style={{ width: '40%' }}>
          <div>
            <p style={{display: 'inline', marginRight: '8px'}}>
              <i className="fas fa-calendar-week" style={{marginRight: '3px'}}/>data
            </p>
            <p style={{display: 'inline', marginRight: '8px'}}>
              <i className="far fa-clock" style={{marginLeft: '3px'}}/>hora
            </p>
            <p style={{display: 'inline', marginRight: '8px'}}>
              <i className="fas fa-map-marker-alt" style={{marginLeft: '3px'}}/>local
            </p>
            <p style={{display: 'inline', marginRight: '8px'}}>
              <i className="fas fa-dollar-sign" style={{marginLeft: '3px'}}/>valor
            </p>
          </div>
          <p>Card content</p>
          <p>Card content</p>
          <p>Card content</p>
        </Card>
      </Timeline.Item>
  );
};

export default TimelineCard;
